import React from "react";
import { Text, Box, Container, Center } from "native-base";
import { Dimensions } from "react-native-web";

const { width, height } = Dimensions.get("window");
const w = width * 0.8;
const h = height * 0.8;

const App = () => {
  return (
    <Center w={width} h={height}>
      <Box w={w} h={h} borderWidth="1" />
    </Center>
  );
};

export default App;
